import { Table } from "react-bootstrap";

function TableCompo({ localData }) {
    const style = {
        width: 800 + "px",
        margin: "23px",
    }
    console.log(localData);

    return <Table style={style} striped bordered hover variant="dark">
        <thead>
            <tr>
                <th>Name</th>
                <th>Profile</th>
                <th>Phone</th>
                <th>Action</th>
            </tr>
        </thead>
        <tbody>
            {localData.tabaleData.length ? localData.tabaleData.map((item) => {
               return <tr>
                    <td>{item.name}</td>
                    <td>{item.profile}</td>
                    <td>{item.number}</td>
                    <td><button>Delete</button></td>
                </tr>
            }) : <></>}


        </tbody>
    </Table>
}
export default TableCompo
